  const cardLogo = () => {
    if (scheme === 'visa') {
      return visa
    } else if (scheme === 'mastercard') {
      return mastercard
    } else if (scheme === 'amex') {
      return amex
    } else if (scheme === 'discover') {
      return discover
    }
  }

